✅De ver 2 veces las 24H de Daytona, a correr aquí 🙌 ¡Y de qué forma!

Primer fin de semana de competencias del Supra, por más que pueda explicar lo que se siente el banking a +250 KPH, no será suficiente, se siente como un vértigo y que el cuerpo se te va a los pies, increíble.

Desde el primer test en Sebring venimos tratando de resolver un tema con el sistema de gasolina que nos impide correr +40 minutos seguidos sin que "falle", desde el jueves de esta semana estábamos en un loop resolviendo eso y tratando de encontrar la falla principal, que durante el camino encontramos otras mínimas que sirven de conocimiento y puesta a punto por lo que fue positivo, pero aún no estamos 100% seguros de cuál es el problema.

Lo que si es seguro es que ni @juice_rivas, @din_arredondo, @axelcabrer.a, @llibre_racing_ y yo no vamos a descansar esta semana buscando posibilidades para poder resolver al 100% e ir a un test en cuanto hagamos los cambios.

Muchas gracias por el seguimiento, correr en un carro de este nivel siempre ha sido un sueño para mi y mis compañeros, y poder compartirlo con ustedes y que muestren tanto interés nos dá mayor motivación para continuar.

Esperen el vídeo recap del fin de semana pronto 🎥.

