Único momento donde se le va el ADD a uno 🤣🤣 testing de Sebring, probando las nuevas suspensiones KW V4 @kw_suspension que hicieron que fuese otro carro full! Si antes nos gustaba, ahora la fiebre es mayor 😅. También probamos el nuevo wing de @aprperformance GT-250 que tiene un poco más de downforce sin sacrificar velocidad de recta. Overall buen testing, hay que seguir dándole. Por cierto, el último vídeo es el más sincero 🤣🤣

Gracias a los muchachos @cabrerajimmy81 @axelcabrer.a @eightsixraceengineering por el soporte, mecánica, detalles y mantenimiento del Supra, @llibre_racing_ en los seteos de suspensión, @graueduardo con el nuevo sistema de gasolina y @sullygarcia69 y @kenjisanportworks con el invento de la barra trasera 😅. También @joelsupra_rd @deltamotorsport @jcastroracing @paul_vera88 con todo el soporte técnico a distancia 🙌. 

